import * as a from './StyledLogin.js';

function Login() {
  return (
    <a.LoginBox>
      <a.LogoWarp>
        <a.Logo src={require('../../images/LogoBlack.png')}/>
      </a.LogoWarp>
        
        <a.InputBox></a.InputBox>
        <a.InputBox></a.InputBox>
    </a.LoginBox>
  );
}

export default Login;
